import React, { PureComponent } from "react";
import { Chart } from "react-google-charts";
import Card from "pnnl-react-core/lib/Card";

class LCSGoogleGraph extends PureComponent {
  constructor(props) {
    super(props);
    var lcs = this.props.data;

    this.data = [
      ["Huebin-Angle", "Local-Chroma Shift"],
      ["Huebin 1", lcs[0]],
      ["Huebin 2", lcs[1]],
      ["Huebin 3", lcs[2]],
      ["Huebin 4", lcs[3]],
      ["Huebin 5", lcs[4]],
      ["Huebin 6", lcs[5]],
      ["Huebin 7", lcs[6]],
      ["Huebin 8", lcs[7]],
      ["Huebin 9", lcs[8]],
      ["Huebin 10", lcs[9]]
    ];

    //this.data = [

    //]
  }

  render() {
    return (
      <Chart
        width={"800px"}
        height={"300px"}
        chartType="Bar"
        loader={<div>Loading Chart</div>}
        data={this.data}
        options={{
          title: "Population of Largest U.S. Cities",
          chartArea: { width: "50%" },
          colors: ["#b0120a", "#ffab91"],
          hAxis: {
            title: "Total Population",
            minValue: 0
          },
          vAxis: {
            title: "City"
          }
        }}
        // For tests
        rootProps={{ "data-testid": "4" }}
      />
    );
  }
}

export default LCSGoogleGraph;
